package com.arf.axd.axdgift.service.impl;import javax.annotation.Resource;import org.springframework.stereotype.Service;import com.arf.axd.axdgift.dao.IAxdGiftConfigDao;import com.arf.axd.axdgift.entity.AxdGiftConfig;import com.arf.axd.axdgift.service.IAxdGiftConfigService;import com.arf.core.dao.BaseDao;import com.arf.core.service.impl.BaseServiceImpl;@Service("axdGiftConfigServiceImpl")public class AxdGiftConfigServiceImpl extends BaseServiceImpl<AxdGiftConfig, Long> implements IAxdGiftConfigService  {	@Resource(name = "axdGiftConfigDaoImpl")	private IAxdGiftConfigDao axdGiftConfigDaoImpl;		@Override	protected BaseDao<AxdGiftConfig, Long> getBaseDao() {		return axdGiftConfigDaoImpl;	}	@Override	public AxdGiftConfig findByCommunityNumber(String communityNumber) {		return axdGiftConfigDaoImpl.findByCommunityNumber(communityNumber);	}}